import React,{useState, useCallback} from 'react';
import MySurvey from '../surveyTypes/suveryTypeOne';

const SurveyOne = () => {
    //shows the comepleted page
    const [showPage, setShowPage] = useState(true);

    //the function for the completePage
    const onCompletePage = useCallback((data)=>{
        console.log(data);
        setShowPage(!showPage)
    },[showPage])

    //the custom final page
    const setFinalPage = () =>{
        return(
            <main>
                <h1>Thank you for taking the survey!</h1>
            </main>
        )
    }
    return(
        //<MySurvey showCompletedPage={data=>onCompletePage(data)}/>
        <div className="App">
            {
                // if showPage is true, shows completed work
                // else, it will show setFinalPage()
                showPage?
                <MySurvey showCompletedPage={data=>onCompletePage(data)} />:
                setFinalPage()
            }
        </div>
    )
}

export default SurveyOne;
